import React from 'react';
import LoadPage from './views/LoadPage';
import Header from './components/layout/Header';
import Logo from './components/Logo'
import Sand from './assets/vehicles/sandcrawler.png'
import Button from './components/Button';
import Card from './components/Card';
import CardCheckout from './components/CardCheckout';
import PaymentType from './components/PaymentType';
import SmallInput from './components/SmallInput';
import Policy from './components/Policy';
import EmailCheckbox from './components/EmailCheckbox';
import robots from './assets/robots.svg'
import TrustCheckout from './components/TrustCheckout';

function App() {
  return (
    <div>
      <Header />
      <div className="relative h-auto w-screen justify">
        <div className="flex h-auto w-screen justify-center items-center">
          <div className="absolute w-full text-center z-40 mt-32 max-w-sm">
            <p className="text-5xl text-green-500">
              &#x1F973;Parabéns&#x1F973;
            </p>
            <p className="text-4xl text-blue-800 mt-6 pl-4 pr-4" >
              Você acabou de adquirir o seu primeiro veículo da saga Star Wars!!
              Sua equipe te aguarda para mais uma corrida!
            </p>
            <div className="mt-6">
              <Button txt={'VEÍCULOS'} />
            </div>
          </div>
          <div className="mt-32 opacity-5 z-0">
            <img src={robots} alt="robots" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
